from collections import Counter

def can_make_strings_equal(s: str, t: str) -> bool:

    def cal(s):
        l = [0] * 26
        cnt = 0
        for i in s:
            cnt += sum(l[ord(i) - 97 + 1:26])
            l[ord(i) - 97] += 1
        return cnt
    n = len(s)
    if len(t) == n:
        return False
    cnt_s = cal(s)
    cnt_t = cal(t)
    C_s = Counter(s)
    C_t = Counter(t)
    if (abs(cnt_s + cnt_t) % 2 == 0 or max(C_s.values()) > 1) and C_s == C_t:
        return True
    else:
        return False

